SET NAMES 'UTF8';
SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS `tblBirdID` CASCADE;
CREATE TABLE `tblBirdID` (
	`BirdID` int NOT NULL COMMENT 'Unique identity number',
	`BTO` varchar(7) NOT NULL COMMENT 'BTO ring',
	`Sex` varchar(1) NOT NULL COMMENT 'Sex of the bird',
	`HatchYear` int COMMENT 'Year of hatching',
	`AgeIsMinEstimate` char COMMENT 'Whether the HatchYear is estimated as the most recent possible for birds first caught as adults',
	PRIMARY KEY (`BirdID`),
	INDEX `BTOring` (`BTO` ASC),
	INDEX `HatchYear` (`HatchYear` ASC)
);


DROP TABLE IF EXISTS `tblBreedData` CASCADE;
CREATE TABLE `tblBreedData` (
	`BreedEventID` int NOT NULL COMMENT 'Unique record identifier',
	`BreedYear` int COMMENT 'Year of the breeding record',
	`SiteID` int COMMENT 'Identifier of the breeding site',
	`MaleID` int COMMENT 'Identifier of the male sparrowhawk at the site',
	`FemaleID` int COMMENT 'Identifier of the female sparrowhawk at the site',
	`TreeAge` int COMMENT 'Approximate age of the tree in which the nest occurred',
	`StableScore` int COMMENT 'Average of breeding success scores over 10 years',
	`MovingScore` int COMMENT 'Average of breeding success scores for the 5 years centred on the current year',
	`ClutchSize` int COMMENT 'Total number of egg laid',
	`Hatched` int COMMENT 'Number of eggs that successfully hatched',
	`Fledged` int COMMENT 'Number of chicks that successfully fledged',
	`BreedSuccess` int COMMENT 'Whether the breeding attempt successfully fledged any offspring',
	`LayPeriod` int COMMENT 'Period when eggs were laid',
	`Growth` float COMMENT 'Index of relative mass-gain rate during the linear phase of nestling growth (definition?)',
	`BreedStatus` varchar(1) COMMENT 'Code describing the final outcome of the breeding attempt',
	PRIMARY KEY (`BreedEventID`),
	INDEX `BreedYear` (`BreedYear` ASC),
	INDEX `FemaleID` (`FemaleID` ASC),
	INDEX `MaleID` (`MaleID` ASC),
	INDEX `SiteID` (`SiteID` ASC)
);


DROP TABLE IF EXISTS `tblCodeList` CASCADE;
CREATE TABLE `tblCodeList` (
	`CodeRef` varchar(20) NOT NULL COMMENT 'Category identifying each set of codes',
	`Value` varchar(15) NOT NULL COMMENT 'Code used in the database',
	`Label` varchar(100) NOT NULL COMMENT 'Translation of the code',
	PRIMARY KEY (`CodeRef`, `Value`),
	INDEX `CodeRef` (`CodeRef` ASC),
	INDEX `Valu` (`Value` ASC)
);


DROP TABLE IF EXISTS `tblErrorLog` CASCADE;
CREATE TABLE `tblErrorLog` (
	`ErrorRef` int NOT NULL,
	`ErrorNumber` int,
	`ErrorDescription` text(8000) NOT NULL,
	`Source` varchar(50) NOT NULL,
	`LineNumber` int,
	`ProcedureName` varchar(50) NOT NULL,
	`Object` varchar(50) NOT NULL,
	`Date` datetime,
	PRIMARY KEY (`ErrorRef`)
);


DROP TABLE IF EXISTS `tblMeasurements` CASCADE;
CREATE TABLE `tblMeasurements` (
	`RowRef` int NOT NULL COMMENT 'Unique record identifier',
	`MeasureDate` datetime COMMENT 'Date of the measurements',
	`MeasureTime` datetime COMMENT 'Time of measurements',
	`BirdID` int COMMENT 'Bird identity number',
	`Wing` float COMMENT 'Wing chord (mm)',
	`Mass` float COMMENT 'Mass of the bird (g)',
	PRIMARY KEY (`RowRef`),
	INDEX `BirdID` (`BirdID` ASC),
	INDEX `BirdIDDate` (`BirdID` ASC, `MeasureDate` ASC)
);


DROP TABLE IF EXISTS `tblOffspring` CASCADE;
CREATE TABLE `tblOffspring` (
	`BirdID` int NOT NULL COMMENT 'Bird identifier',
	`BreedEventID` int COMMENT 'Identifier of the breeding event record',
	PRIMARY KEY (`BirdID`),
	INDEX `BreedEventID` (`BreedEventID` ASC)
);


DROP TABLE IF EXISTS `tblPesticides` CASCADE;
CREATE TABLE `tblPesticides` (
	`BreedEventID` int NOT NULL COMMENT 'Unique record identifier',
	`DDE` float COMMENT 'Level of DDE in the yolk of eggs from the nest (units?)',
	`PCB` float COMMENT 'Level of PCB in the yolk of eggs from the nest (units?)',
	`Dieldrin` float COMMENT 'Level of Dieldrin in the yolk of eggs from the nest (units?)',
	`ShellIndex` float COMMENT 'Index of shell thickness of eggs in the nest (definition)',
	PRIMARY KEY (`BreedEventID`)
);


DROP TABLE IF EXISTS `tblSiteList` CASCADE;
CREATE TABLE `tblSiteList` (
	`SiteID` int NOT NULL COMMENT 'Unique identifier of the site',
	`Region` varchar(1) NOT NULL COMMENT 'Study area in which the bird was found',
	`Altitude` float COMMENT 'Approximate altitude of the nest (metres)',
	`LandUse` int COMMENT 'Broad land use type surrounding the nest/territory',
	PRIMARY KEY (`SiteID`)
);


DROP TABLE IF EXISTS `tblTableFieldList` CASCADE;
CREATE TABLE `tblTableFieldList` (
	`TableName` varchar(64) NOT NULL COMMENT 'Name of the database table',
	`FieldName` varchar(64) NOT NULL COMMENT 'Name of the field in the table',
	`CodeRef` varchar(50) NOT NULL COMMENT 'Category of codes used for data in this field',
	`FieldDescription` varchar(255) NOT NULL COMMENT 'Description of the contents of the field',
	`FieldType` varchar(10) NOT NULL COMMENT 'Data type of the field',
	`FieldSize` int COMMENT 'Storage requirement of the field (bytes)',
	PRIMARY KEY (`TableName`, `FieldName`),
	INDEX `CodeRef` (`CodeRef` ASC),
	INDEX `TableName` (`TableName` ASC)
);


DROP TABLE IF EXISTS `tblTableList` CASCADE;
CREATE TABLE `tblTableList` (
	`TableName` varchar(25) NOT NULL COMMENT 'Name of the database table',
	`Description` varchar(250) NOT NULL COMMENT 'Description of the table',
	PRIMARY KEY (`TableName`)
);


